      out.write("const showPasswordButton = document.querySelector('.current-password button');\r\n");
      out.write("\r\n");
      out.write("let checkPw = false;\r\n");
      out.write("\r\n");
      out.write("/*기존 비밀번호 입력 */\r\n");
      out.write("function validatePassword() {\r\n");
      out.write("  	if (currentPasswordInput.value.trim() === '') {\r\n");
      out.write("	    message.innerText = '비밀번호를 입력해주세요.';\r\n");
      out.write("	    message.style.color = 'red';\r\n");
      out.write("	    currentPasswordInput.classList.add(\"is-invalid\");\r\n");
      out.write("	    return true;\r\n");
      out.write("  	} else {\r\n");
      out.write("		checkPw = false;\r\n");
      out.write("		$.ajax({\r\n");
      out.write("			url: \"checkPwOk.mypage\",\r\n");
      out.write("			data: {inputUserPassword: currentPasswordInput.value},\r\n");
      out.write("			async: false,\r\n");
      out.write("			success: function(result) {\r\n");
      out.write("				result = JSON.parse(result);\r\n");
      out.write("				if(result.check) {\r\n");
      out.write("					// 일치하다\r\n");
      out.write("					message.innerHTML = \"\";\r\n");
      out.write("	  				currentPasswordInput.classList.remove(\"is-invalid\");\r\n");
      out.write("					checkPw = true;\r\n");
      out.write("				} else {\r\n");
      out.write("					message.innerText = '기존 비밀번호와 다릅니다';\r\n");
      out.write("				    message.style.color = 'red';\r\n");
      out.write("				    currentPasswordInput.classList.add(\"is-invalid\");\r\n");
      out.write("					checkPw = false;\r\n");
      out.write("				}\r\n");
      out.write("			}\r\n");
      out.write("		})\r\n");
      out.write("	}\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function submit() {\r\n");
      out.write("	if (validatePassword() && validatePasswordInputs()) {\r\n");
      out.write("    	document.updatePw.submit();\r\n");
      out.write("  	}\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("/* 새로운 비밀번호 입력 */\r\n");
      out.write("\r\n");
      out.write("function validateNewPassword() {\r\n");
      out.write("  const newPasswordValue = newPasswordInput.value;\r\n");
      out.write("  if (!newPasswordValue) {\r\n");
      out.write("    newPasswordMessage.innerText = '비밀번호를 입력해주세요.';\r\n");
      out.write("    newPasswordMessage.style.color = 'red';\r\n");
      out.write("    newPasswordInput.classList.add(\"is-invalid\");\r\n");
      out.write("    \r\n");
      out.write("    return false;\r\n");
      out.write("  }\r\n");
      out.write("  if (!/^(?=.*[a-zA-Z])(?=.*[0-9]).{8,}$/.test(newPasswordValue)) {\r\n");
      out.write("    newPasswordMessage.innerText = '영문+숫자 조합 8자리 이상 입력해주세요.';\r\n");
      out.write("    newPasswordMessage.style.color = 'red';\r\n");
      out.write("    newPasswordInput.classList.add(\"is-invalid\");\r\n");
      out.write("    return false;\r\n");
      out.write("  }else{\r\n");
      out.write("	  newPasswordMessage.innerHTML = \"\";\r\n");
      out.write("	newPasswordInput.classList.remove('is-invalid');\r\n");
      out.write("  }\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("/* 새로운 비밀번호 확인 */\r\n");
      out.write("\r\n");
      out.write("function validateConfirmPassword() {\r\n");
      out.write("  const newPasswordValue = newPasswordInput.value;\r\n");
      out.write("  const confirmPasswordValue = confirmPasswordInput.value;\r\n");
      out.write("  if (newPasswordValue !== confirmPasswordValue) {\r\n");
      out.write("    confirmPasswordMessage.innerText = '비밀번호가 일치하지 않습니다.';\r\n");
      out.write("    confirmPasswordMessage.style.color = 'red';\r\n");
      out.write("    confirmPasswordInput.classList.add(\"is-invalid\");\r\n");
      out.write("    return false;\r\n");
      out.write("  }else{\r\n");
      out.write("	  confirmPasswordMessage.innerText = \"\";\r\n");
      out.write("	  confirmPasswordInput.classList.remove(\"is-invalid\");\r\n");
      out.write("	  \r\n");
      out.write("  }\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function validatePasswordInputs() {\r\n");
      out.write("  return validateNewPassword() && validateConfirmPassword();\r\n");
      out.write("}\r\n");
      out.write("/* 입력화면에서 벗어나면 즉시 값반영해서 맞는지 아닌지 판별 */\r\n");
      out.write("currentPasswordInput.addEventListener('blur', validatePassword);\r\n");
